import { LButton } from './Button.styled';
import PropTypes from 'prop-types';

const Button = ({ onClick }) => {
  return (
    <LButton onClick={onClick} type="button">
      Load more
    </LButton>
  );
};

export default Button;

Button.propTypes = {
  onClick: PropTypes.func.isRequired,
};
